      "originalJapaneseLine": "「うわーーーーん！」",
      "translatedEnglishLine": "\"Waaaaaah!\""
    },
    {
      "lineNumber": 121112,
      "originalJapaneseLine": "「……いや、まあ。すまんとは思うとるよ。",
      "translatedEnglishLine": "\"...Well, I do feel sorry about it.\""
    },
    {
      "lineNumber": 121113,
      "originalJapaneseLine": "　今後はユーティンの仕事分担して、",
      "translatedEnglishLine": " \"From now on, I'll share Yutin's workload,"
    },
    {
      "lineNumber": 121114,
      "originalJapaneseLine": "　いつでも休み取れるようにしたるから」",
      "translatedEnglishLine": " so you can take time off whenever you want.\""
    },
    {
      "lineNumber": 121115,
      "originalJapaneseLine": "「あ、いえ、お約束なので泣きましたが、",
      "translatedEnglishLine": "\"Ah, no, I cried because it was a promise,"
    },
    {
      "lineNumber": 121116,
      "originalJapaneseLine": "　コパンドン様に求められるのは嬉しいので、",
      "translatedEnglishLine": " but I'm happy to be wanted by Lord Copandon,"
    },
    {
      "lineNumber": 121117,
      "originalJapaneseLine": "　別にこのままでいいです」",
      "translatedEnglishLine": " so I'm fine with it as it is.\""
    },
    {
      "lineNumber": 121118,
      "originalJapaneseLine": "「あ、というか、私がいないと",
      "translatedEnglishLine": "\"Ah, or rather, if I'm not here,"
    },
    {
      "lineNumber": 121119,
      "originalJapaneseLine": "　コパンドン様が困るって、",
      "translatedEnglishLine": " Lord Copandon gets troubled,"
    },
    {
      "lineNumber": 121120,
      "originalJapaneseLine": "　それもうすごい幸せで……」",
      "translatedEnglishLine": " and that makes me incredibly happy...\""
    },
    {
      "lineNumber": 121121,
      "originalJapaneseLine": "「いや、アカンて……",
      "translatedEnglishLine": "\"No, that's not good...\""
    },
    {
      "lineNumber": 121122,
      "originalJapaneseLine": "　変な子やね」",
      "translatedEnglishLine": "\"You're a strange kid.\""
    },
    {
      "lineNumber": 121123,
      "originalJapaneseLine": "なんだかんだ、ユーティンは楽しそうだった。",
      "translatedEnglishLine": "Despite everything, Yutin looked happy."
    },
    {
      "lineNumber": 121124,
      "originalJapaneseLine": "「あはぁ〜〜〜♪　温泉気持ちいい〜♪」",
      "translatedEnglishLine": "\"Ahh~♪ The hot spring feels so good~♪\""
    },
    {
      "lineNumber": 121125,
      "originalJapaneseLine": "深夜にこっそりとユーティンが",
      "translatedEnglishLine": "Late at night, secretly,"
    },
    {
      "lineNumber": 121126,
      "originalJapaneseLine": "温泉を楽しんでいた。",
      "translatedEnglishLine": " Yutin was enjoying the hot spring."
    },
    {
      "lineNumber": 121127,
      "originalJapaneseLine": "「ふたなりだから、",
      "translatedEnglishLine": "\"Because I'm futanari,"
    },
    {
      "lineNumber": 121128,
      "originalJapaneseLine": "　人のいない時間に入らないとなのが、",
      "translatedEnglishLine": " I have to bathe when no one is around,"
    },
    {
      "lineNumber": 121129,
      "originalJapaneseLine": "　困りものだけど、やっぱり温泉いいなあ……」",
      "translatedEnglishLine": " which is troublesome, but the hot spring really is nice...\""
    },
    {
      "lineNumber": 121130,
      "originalJapaneseLine": "「あら？　誰か入ってきちゃった？」",
      "translatedEnglishLine": "\"Oh? Did someone come in?\""
    },
    {
      "lineNumber": 121131,
      "originalJapaneseLine": "「残念だけど、",
      "translatedEnglishLine": "\"That's unfortunate,"
    },
    {
      "lineNumber": 121132,
      "originalJapaneseLine": "　なら私は出ようかな……」",
      "translatedEnglishLine": " then I'll leave...\""
    },
    {
      "lineNumber": 121133,
      "originalJapaneseLine": "「はあ、一般世界だとふたなりは",
      "translatedEnglishLine": "\"Hah, in the normal world, futanari"
    },
    {
      "lineNumber": 121134,
      "originalJapaneseLine": "　色々と気を遣うなぁ……」",
      "translatedEnglishLine": " require a lot of consideration...\""
    },
    {
      "lineNumber": 121135,
      "originalJapaneseLine": "「って、えっ、えっ……ええっ！？",
      "translatedEnglishLine": "\"Wait, huh, huh... what!?\""
    },
    {
      "lineNumber": 121136,
      "originalJapaneseLine": "新たな客は何故か一直線に",
      "translatedEnglishLine": "A new visitor for some reason headed straight"
    },
    {
      "lineNumber": 121137,
      "originalJapaneseLine": "ユーティンのもとへ向かってきた。",
      "translatedEnglishLine": " toward Yutin."
    },
    {
      "lineNumber": 121138,
      "originalJapaneseLine": "「こんばんは〜」",
      "translatedEnglishLine": "\"Good evening~\""
    },
    {
      "lineNumber": 121139,
      "originalJapaneseLine": "「え、あ、はい……」",
      "translatedEnglishLine": "\"Eh, ah, yes...\""
    },
    {
      "lineNumber": 121140,
      "originalJapaneseLine": "「突然ですけど……」",
      "translatedEnglishLine": "\"This is sudden, but...\""
    },
    {
      "lineNumber": 121141,
      "originalJapaneseLine": "「お××××触らせて下さい！」",
      "translatedEnglishLine": "\"Please let me touch your p****!\""
    },
    {
      "lineNumber": 121142,
      "originalJapaneseLine": "「…………",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 121143,
      "originalJapaneseLine": "えっ？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 121144,
      "originalJapaneseLine": "「えええええええええ！？」",
      "translatedEnglishLine": "\"Eeeeehhhh!?!?\""
    },
    {
      "lineNumber": 121145,
      "originalJapaneseLine": "「前から興味あったので触らせて下さい！」",
      "translatedEnglishLine": "\"I've been curious for a long time, so please let me touch it!\""
    },
    {
      "lineNumber": 121146,
      "originalJapaneseLine": "「あ、そういうのいいの？",
      "translatedEnglishLine": "\"Ah, that's okay with that kind of thing?"
    },
    {
      "lineNumber": 121147,
      "originalJapaneseLine": "　じゃあ、私もー」",
      "translatedEnglishLine": " Then, me too—\""
    },
    {
      "lineNumber": 121148,
      "originalJapaneseLine": "「うわぁ、誰かいた！？",
      "translatedEnglishLine": "\"Wow, someone is here!?\""
    },
    {
      "lineNumber": 121149,
      "originalJapaneseLine": "「うふふ、おねーさん、",
      "translatedEnglishLine": "\"Ufufu, big sister,"
    },
    {
      "lineNumber": 121150,
      "originalJapaneseLine": "　ちょーっち興味あったのよねー」",
      "translatedEnglishLine": " I've been a little interested, you know—\""
    },
    {
      "lineNumber": 121151,
      "originalJapaneseLine": "「あ、ちょ、えっ！？",
      "translatedEnglishLine": "\"Ah, wait, huh!?"
    },
    {
      "lineNumber": 121152,
      "originalJapaneseLine": "　いやっ、そういうの困ります！",
      "translatedEnglishLine": " No, that kind of thing is troublesome!"
    },
    {
      "lineNumber": 121153,
      "originalJapaneseLine": "　私はコパンドン様の奴隷で――！」",
      "translatedEnglishLine": " I am Lord Copandon's slave—!\""
    },
    {
      "lineNumber": 121154,
      "originalJapaneseLine": "「あっ、嫌だとは言わないのね。",
      "translatedEnglishLine": "\"Ah, you don't say no, huh."
    },
    {
      "lineNumber": 121155,
      "originalJapaneseLine": "　おっけー」",
      "translatedEnglishLine": " Okay then.\""
    },
    {
      "lineNumber": 121156,
      "originalJapaneseLine": "「ああっ、そういうことではなくー！」",
      "translatedEnglishLine": "\"Ah, that's not what I meant—!\""
    },
    {
      "lineNumber": 121157,
      "originalJapaneseLine": "「だいじょーぶ、痛くしなーい。",
      "translatedEnglishLine": "\"It's okay, I won't hurt you."
    },
    {
      "lineNumber": 121158,
      "originalJapaneseLine": "　ほほー、これが天然ものかー」",
      "translatedEnglishLine": " Hoho, so this is the natural kind—\""
    },
    {
      "lineNumber": 121159,
      "originalJapaneseLine": "「おお、すごい……",
      "translatedEnglishLine": "\"Oh, amazing..."
    },
    {
      "lineNumber": 121160,
      "originalJapaneseLine": "　男の人のそれとまったく一緒だー……」",
      "translatedEnglishLine": " It's exactly the same as a man's...\""
    },
    {
      "lineNumber": 121161,
      "originalJapaneseLine": "「あはっ、ピクピクしてるー♪」",
      "translatedEnglishLine": "\"Aha, it's twitching♪\""
    },
    {
      "lineNumber": 121162,
      "originalJapaneseLine": "「あ、あ、あ……」",
      "translatedEnglishLine": "\"Ah, ah, ah...\""
    },
    {
      "lineNumber": 121163,
      "originalJapaneseLine": "「あんまり……触られりゅと、駄目ですぅ……」",
      "translatedEnglishLine": "\"If you touch me too much... I can't...\""
    },
    {
      "lineNumber": 121164,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 121165,
      "originalJapaneseLine": "　　＜むく、むくむくむく……＞",
      "translatedEnglishLine": "  <swelling, swelling, swelling...>"
    },
    {
      "lineNumber": 121166,
      "originalJapaneseLine": "血液が集中し、ペニスが大きく膨らみ、",
      "translatedEnglishLine": "Blood concentrated, the penis swelled greatly,"
    },
    {
      "lineNumber": 121167,
      "originalJapaneseLine": "天を突くように上を向き始めた。",
      "translatedEnglishLine": " and began pointing upwards toward the sky."
    },
    {
      "lineNumber": 121168,
      "originalJapaneseLine": "「や……やだ、ぁ……」",
      "translatedEnglishLine": "\"No... please, ah...\""
    },
    {
      "lineNumber": 121169,
      "originalJapaneseLine": "「きゃーーーー♪」",
      "translatedEnglishLine": "\"Kyaaa~~~♪\""
    },
    {
